  `RELEASETIME` timestamp NULL DEFAULT NULL COMMENT '解禁时间',
  `DISABLETYPE` tinyint(4) DEFAULT '1' COMMENT '2半年0永久',
  `ISDISABLE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否被禁用过',
  `IDCARD_PHOTO` int(11) DEFAULT '1' COMMENT '身份证正面照',
