  UNIQUE KEY `UNIQUE_IDCARD` (`IDCARD`) USING BTREE,
  UNIQUE KEY `UNIQUE_MOBILE` (`MOBILE`) USING BTREE,
  KEY `FK_TEACHER_ETHNIC` (`ETHNIC`),
  KEY `FK_TEACHER_PHOTO` (`PHOTO`),
